import React from "react";
import NavBar from "../components/NavBar";
import TopBar from "../components/TopBar";

function UserDetails() {
  return (
    <div>
      <div className="absolute top-40 right-8 w-3/4 h-auto bg-white p-2">
        <div>
            <h1 className="text-xl font-mono">ocdhsdi</h1>
            <p className="font-sans">kjsbdwonf</p>
        </div>
      </div>
      <TopBar />
      <NavBar />
    </div>
  );
}

export default UserDetails;
